{"attr":"script","list":[{"evt":"exec_on_update","param":"if (window.CB1LRStatus === undefined) {
 class Watcher {
 constructor(getter) {
 this._callback = undefined;
 this._getter = getter;
 this._oldValue = undefined;
 Object.defineProperty(this, 'value', {
 set: (val) => {
 'ignore'
 },
 get: function () {
 const value = this._getter();
 this._oldValue != value && this._callback && this._callback(value);
 return this._oldValue = value;
 }
 });
 }

 onchange(callback) {
 this._callback = callback;
 }

 check() {
 return this.value;
 }
 }


 window.CB1LRStatus = new Watcher(() => $V('CB1LRStatus'));

 const controller = document.querySelector('#CB1PosStatus');

 const actionMap = new Map([
 [0, () => {
 controller.onclickHide = controller.onclick;
 controller.onclick = '';
 controller.style.cursor = '';
 }],
 [1, () => {
 controller.onclick = controller.onclickHide ?? controller.onclick;
 controller.style.cursor = 'pointer';
 }]
 ]);

 CB1LRStatus.onchange(value => {
 if (actionMap.has(value)) {
 actionMap.get(value)();
 }
 })
}

window.CB1LRStatus.check();"}]},{"attr":"text","map":["0=LOC","1=REM"],"tag":"CB1LRStatus"}
